  constructor(props){
    super(props);

  }

  _isMounted=false;

  componentDidMount(){
   this._isMounted=true;
  }

  componentWillUnmount(){
    this._isMounted=false;
  }

  changeState(data){
    if(this._isMounted){
      this.setState(data)
    }
  }


  render() {
  	if(this.props.page === 'ConfigureScreening'){
	    return (
	    	<div>
          <h1> inside configure screening </h1>


          <div id = "Timeline">
            <a href="#" id="hideTimeline">Show</a>
            <a href="#" id="showTimeline">Hide1</a>
            <div id="contentTimeline"><p>Answer1</p></div>
          </div>

          <div id = "StudentSheet">
            <a href="#" id="hideStudentSheet">Show</a>
            <a href="#" id="showTimeline">Hide2</a>
            <div id="contentStudentSheet"><p>Answer2</p></div>
          </div>

          <div id = "PartnerSheet">
            <a href="#" id="hidePartnerSheet">Show</a>
            <a href="#" id="showPartnerSheet">Hide3</a>
            <div id="contentPartnerSheet"><p>Answer3</p></div>
          </div>


		    </div>
	    )
		} else{
    	return null;
    }
  }

}


export default ConfigureScreening;
